import React, {Component,Fragment} from 'react';
import HaHa from "./Children/HaHa";
import FriendsCircle from "../router/bottom/FriendsCircle";
import My from "./Children/My";
import Question from "./Children/Question";
import{
    NavLink as Nav,
    Route
} from 'react-router-dom'
export default class Index extends Component{
    constructor(props) {
        super(props);
        this.state={};
    }
    Friend=()=>{
        this.props.history.go('/FriendsCircle')
    }
    render() {
        return (
            <Fragment>
                    <Route component={HaHa} exact path={"/"}></Route>
                    <Route component={Question} path={"/question"}></Route>
                    <Route component={My} path={"/my"}></Route>
                <nav className={"Nav"}>

                    <Nav className={"App-Link"} activeClassName={"App-active"} to={"/friendsCircle"}><i><img  alt={"标本"} src="/img/Fkpdn7F9EWxvNeSS8M7V4_xbRPlf?50X50&imageView2/1/w/50/h/50"/></i><span>烘焙圈</span></Nav>
                    <Nav className={"App-Link"} activeClassName={"App-active"} to={"/question"}><i><img  alt={"标本"} src="/img/Flm_lYHJQA56h0VyhdRhQ1i5iO06?50X50&imageView2/1/w/50/h/50" /></i><span>问答</span></Nav>
                    <Nav className={"App-Link"} activeClassName={"App-active"} to={"/my"}><i><img  alt={"标本"} src="/img/FrYeKj0MohOJQuNzUgCugg90cHCS?50X50&imageView2/1/w/50/h/50" /></i><span>我的</span></Nav>
                </nav>
                <span  className={"App-Link"} activeClassName={"App-active"} onClick={this.Friend} ><i><img onClick={this.Friend} alt={"标本"} src="/img/FsxN7RUFRJ9Zdris5Z22haR2xIhj?50X50&imageView2/1/w/50/h/50"/></i>学烘焙</span>
            </Fragment>
        )
    }
}
